import {getMovies} from "../services/fakeMovieService";

class Movies extends Component {
    state = {
        movies: getMovies()
    }
    render() {
        return (
            <reactFragment>
                <table class="table">
                    <thead>
                    <tr>
                        <th scope="col">Title</th>
                        <th scope="col">Genre</th>
                        <th scope="col">S</th>
                        <th scope="col">Title</th>
                        <th scope="col">Title</th>
                    </tr>
                    </thead>

                </table>

            </reactFragment>
        );
    }
}

export default Movies;
